import { ListItem, ListItemText } from '@material-ui/core'
import React from 'react'

export const TodoList = ({ todo }) => {
    return (
        <div>
            <ListItem>
                <ListItemText primary={todo}  />
            </ListItem>
            <p>{todo}</p>
        </div>
    )
}
